import React from 'react'



const Humans = ( {filterPersons, handleDeleteChange} ) => {
    return(
        <ul>
            {filterPersons.map(person =>
            <li key={person.id}>{person.name} {person.phoneNumber} <button onClick={handleDeleteChange(person.id)}>Delete</button></li>
            )}
        </ul>
    )
}

export default Humans
